import React from 'react';
import Header from './components/Header';
import './App.css';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import homeImage from './images/home.jpg';
import project1Image from './images/project1.jpg'; // Import the image for Project 1
import project2Image from './images/project2.jpg'; // Import the image for Project 2

const App = () => {
  // Example project data (replace with your actual project data)
  const projects = [
    { title: 'Project 1', image: project1Image, description: 'Description for Project 1' },
    { title: 'Project 2', image: project2Image, description: 'Description for Project 2' },
    // Add more projects here
  ];

  return (
    <div className="app">
      <Header />
      <main className="main-content">
        <div className="image-container">
          <img className="home-image" src={homeImage} alt="Home" />
        </div>
        <div className="color-block">
          <h2>Welcome to Narae's Portfolio!</h2>
          <p>"At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis ..."</p>
        </div>

        {/* Carousel for Recent Projects */}
        <div className="recent-projects">
          <h2>Recent Projects</h2>
          <Carousel
            autoPlay
            infiniteLoop
            showThumbs={false}
            showStatus={false}
          >
            {projects.map((project, index) => (
              <div key={index}>
                <img src={project.image} alt={project.title} />
                <h3>{project.title}</h3>
                <p>{project.description}</p>
              </div>
            ))}
          </Carousel>
        </div>
      </main>
    </div>
  );
};

export default App;
